import {BrowserRouter, Route, Routes} from 'react-router-dom';
import DivCalc from "./page/DividendCalculator";
import React from 'react';
import './App.css';

function App() {
    return (
        <div className="App">
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={<DivCalc />} />
                </Routes>
            </BrowserRouter>
        </div>
    );
}


export default App;
